import React, { Component } from 'react';
// import { Navbar, Nav} from 'react-bootstrap';
import PropTypes from 'prop-types';
import { withStyles } from 'material-ui/styles';
import AppBar from 'material-ui/AppBar';
import Toolbar from 'material-ui/Toolbar';
import Typography from 'material-ui/Typography';
import IconButton from 'material-ui/IconButton';
import MenuIcon from 'material-ui-icons/Menu';
import AccountCircle from 'material-ui-icons/AccountCircle';

const styles = theme => ({
    root: {
        marginTop: theme.spacing.unit * 3,
        width: '100%'
    },
    flex: {
        flex: 1
    },
    menuButton: {
        marginLeft: -12,
        marginRight: 20
    }
})

class NavBar extends Component {
    state = {}
    render() {
        return (

            // <Navbar bg="dark" expand="lg" variant="dark">
            //     <Navbar.Toggle aria-controls="basic-navbar-nav" />
            //     <Navbar.Collapse id="basic-navbar-nav">
            //         <Nav className="mr-auto">
            //             <Nav.Link href="/control">Control</Nav.Link>
            //             <Nav.Link href="/data">Data</Nav.Link>
            //             <Nav.Link href="/profile">Profile</Nav.Link>
            //         </Nav>

            //     </Navbar.Collapse>
            // </Navbar>

            <AppBar position="static" elevation={0}>
                <Toolbar>
                    <IconButton className={classes.menuButton} color="contrast" onClick={this.props.toggleDrawer}><MenuIcon /></IconButton>
                    <Typography className={classes.flex} type="title" color="inherit">
                        Material-UI Demo App
            </Typography>
                    <div>
                        <IconButton color="contrast" onClick={this.props.login}>
                            <AccountCircle />
                        </IconButton>
                    </div>
                </Toolbar>
            </AppBar>

        );

    }
}

Navbar.propTypes = {
    classes: PropTypes.object.isRequired
};

export default NavBar;
